npx create-react-app client
```
2. Set up the server:

Create a new file called `server.js` in the root directory of your project:
```
touch server.js
```
Add the following code to `server.js`:
```javascript
const express = require('express');
const cors = require('cors');
const bodyParser = require('body-parser');

const app = express();

app.use(cors());
app.use(bodyParser.json());

// Add your routes here

const PORT = process.env.PORT || 5000;

app.listen(PORT, () => {
  console.log(`Server is running on port ${PORT}`);
});
```
3. Set up the client:

Navigate to the `client` directory and install Axios to make HTTP requests:
```
cd client
npm install axios
```
4. Create dummy data:

You can create dummy data by adding it to your server or client code. For example, you can add an array of objects to your server code and use it to respond to GET requests:
```javascript
const dummyData = [
  { id: 1, name: 'Item 1' },
  { id: 2, name: 'Item 2' },
  { id: 3, name: 'Item 3' },
];

app.get('/api/items', (req, res) => {
  res.json(dummyData);
});
```
5. Show the data:

You can display the data in your React app by making a GET request to your server using Axios:
```javascript
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [items, setItems] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios('/api/items');
      setItems(result.data);
    };

    fetchData();
  }, []);

  return (
    <div>
      {items.map((item) => (
        <div key={item.id}>
          <h2>{item.name}</h2>
        </div>
      ))}
    </div>
  );
}

export default App;
```
6. Deploy the code:

To deploy your code, you can use a service like Heroku. First, create a new Heroku app:
```
heroku create
```
Then, add a start script to your `package.json` file:
```json
"scripts": {
  "start": "node server.js",
  "client": "npm start --prefix client",
  "dev": "concurrently \"npm run start\" \"npm run client\""
}
```
Finally, deploy your code to Heroku:
```
git push heroku master
```

That's it! You now have a web application using React, Node.js, and Express.js that can create, add, and display dummy data.

