Static variables and register variables are two types of variables in C programming language.

1. Static variables:
A static variable is a variable that has been allocated statically, meaning that its lifetime is the entire duration of the program. Static variables are declared using the keyword "static" and can be either local or global.

Local static variables are declared inside a function and retain their value between function calls. They are initialized only once, at the first call of the function, and their value is preserved between subsequent calls.

Global static variables are declared outside of any function and are accessible only within the file in which they are declared. They are initialized to zero by default.

Here is an example of a local static variable:
```c
#include <stdio.h>

void incrementCounter() {
    static int counter = 0;
    counter++;
    printf("Counter: %d\n", counter);
}

int main() {
    incrementCounter();
    incrementCounter();
    incrementCounter();
    return 0;
}
```
In this example, the variable "counter" is declared as a static variable inside the function "incrementCounter". The value of "counter" is preserved between function calls, so the output of this program will be:
```
Counter: 1
Counter: 2
Counter: 3
```

2. Register variables:
A register variable is a variable that is stored in a register of the CPU instead of RAM. Register variables are declared using the keyword "register" and are used to improve the performance of the program by reducing the number of memory accesses.

Register variables are typically used for variables that are accessed frequently, such as loop

